import { Icon } from "semantic-ui-react";
import { SideNavOption } from "../types/SideNavTypes";

type SideNavProps = {
    title: string;
    options: SideNavOption[];
    isOpen: boolean;
    handleClickClose: () => void;
}

const SideNav: React.FC<SideNavProps> = (props) => {
    const {title, options, handleClickClose} = props;

    return (
        <div className="sidenav closebtn">
            <h1>{title}</h1>
            <Icon
                name='close' 
                link
                inverted
                circular
                className='menu-button'
                onClick={handleClickClose}
            />
            { options.map((option: SideNavOption) => {
                return (<a href={option.link}>{option.name}</a>);
            })}
            <a href="#">+Create New Map</a>
        </div>
    )
};

export default SideNav
